import { Component } from '@angular/core';

@Component({
  selector: 'app-nav-menu',
  templateUrl: './nav-menu.component.html',
  styleUrls: ['./nav-menu.component.css'],
})
export class NavMenuComponent {
  isExpanded = false;
  logoUrl: string = 'assets/images/logo-navbar.png';

  collapse() {
    this.isExpanded = false;
  }

  toggle() {
    this.isExpanded = !this.isExpanded;
  }
}
<header>
  <nav class="navbar navbarContainer navbar-expand-lg navbar-light bg-light">
    <div class="container-fluid navContainer justify-content-center">
      <div class="row justify-content-center">
        <div class="col-8 w-100">
          <img [src]="logoUrl" alt="logo" />
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse justify-content-between" id="navbarNav">
            <div class="navbar-nav">
              <a class="nav-link start" aria-current="page" href="#">START</a>
              <a class="nav-link" href="#">PROMOCJE</a>
              <a class="nav-link" href="#">Krok po kroku</a>
              <a class="nav-link" href="#">Ceny</a>
              <a class="nav-link" href="#">Flota</a>
              <a class="nav-link" href="#">Gdzie jesteśmy</a>
              <a class="nav-link" href="#">Dla Firm</a>
              <a class="nav-link" href="#">KONTAKT I PYTANIA</a>
              <a class="nav-link" href="#">Rent a Car</a>
              <a class="nav-link new-app" href="#">NOWA APLIKACJA</a>
            </div>
          </div>
        </div>
      </div>
    </div>
  </nav>
</header>
